import React, { Component } from 'react';
import { Route } from 'react-router-dom';

class Home extends Component {
  render() {
    return (
      <div>
        <h2>Home</h2>
        <p> My awesome Home component </p>
        <Route exact path='/' component={Home} />
      </div>
    );
  }
}

export default Home;
